import styled from "styled-components";

const Style = styled.div`
background : black;
.head {
    padding: 20px;
    .headTitle {
        text-transform: uppercase;
        font-family: "Poppins", sans-serif;
        font-weight: 600;
        line-height: 14px;
        font-size: 12px;
        color: white;
    }
}
`;

export default Style;
